import styled from 'styled-components';
import bgimg from '../assets/bgimg.jpg'

export default styled.div`
	height: 100%;
	width: 100%;
	background-color: #1a1a1a;

	color: white;
	font-family: 'Cuprum', sans-serif;

	a {
		color: white;
		text-decoration: none;
	}

	padding-top: 70px;
`;
